import React from "react";
import { Link } from "react-router-dom";
import "./style.css";


function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg  coolFont">
      <Link className="navbar-brand text-light coolFont" to="/">
        A List
      </Link>
      <div>
        <ul className="navbar-nav">

        <li className="nav-item">
            <Link
              to="/create-profile"
              className={window.location.pathname === "/create-profile" ? "nav-link active" : "nav-link"}
            >
              Create a Profile
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="/query"
              className={window.location.pathname === "/query" ? "nav-link active" : "nav-link"}
            >
              Search Musicians
            </Link>
          </li>



        </ul>
      </div>
      <h1 className="coolFont text-white" id="header">The A-List</h1>
      <h3 className="coolFont text-secondary" id="headerSecondary">Find The Right Musician For The Job</h3>
    </nav>
  );
}

export default Navbar;
